import React from "react";
import styled from "styled-components";

function FifthPage() {
  return (
    <Container>
      <img src="/images/model-s/model-s-blue.jpg" alt="" />
      <div></div>
    </Container>
  );
}

const Container = styled.div`
  height: 98vh;
  background: rgb(249, 249, 249);

  img {
    width: 100%;
    height: 50%;
  }
`;
export default FifthPage;
